import React from "react";
import { BrowserRouter as Router, Routes, Route, Link, Outlet, useParams, }
from "react-router-dom";
import "./App.css"

export default function App() {
  return ( 
  <Router>
    <nav>
      <Link className="text-decoration" to="/">Home</Link>
      <Link className="text-decoration" to="product">Product</Link>
    </nav>
    <Routes className="text-decoration">
      <Route path="/" element={<Home />} />
      <Route path="product" element={<Product />} >
      <Route path="/" element={<LaunchIndex />} />
      <Route path=":slug" element={<LaunchShoe />} />
      </Route>
      <Route path="*" element={<NotFound /> }/>
    </Routes>
  </Router>
  );
} 

function NotFound(){
  return ( 
   <div>
     <h1>Not Found!</h1>
     <p>Sorry your page is not found!</p>
   </div>
  )
}



function Home(){
  return ( 
   <div>
     <h1>Welcome Home</h1>
     <img src="https://image.shutterstock.com/image-photo/sport-shoes-260nw-565500208.jpg" height="700" width="800" />
   </div>
  )
}
function Product(){
  return (
   <div>
     <h1>Product</h1>
     <Outlet />
   </div>
  );
}
function LaunchIndex() {
  return (
    <ul className="productContainer">
       {Object.entries(shoes).map(([slug, { name, img, price }]) => (
         <li key={slug} className="link">
           <h3>{name}</h3>
           <Link to={`/product/${slug}`}  >
           <img src={img} alt={name} height="400" />
           <h2>{price}</h2>
           <button className="btn">Add to Cart</button>
           </Link>
         </li>
       ))}
    </ul>
  );
} 
function LaunchShoe() {
  const { slug } = useParams();
  const shoe = shoes[slug];

if(!shoe) {
  return(
    <h2>Product Not Found</h2>
  )
}
const {name, img, price} = shoe;
  return (
    <div className="Pro" >
      <h2>{name}</h2>
      <img src={img} alt={name} height="500" />
      <h2>{price}</h2>

    </div>
  )
}

const shoes = {


  "Men Navy Run Swift Running Shoes": {
    name: "Men Navy Run Swift Running Shoes",
    price: "Rs.6000"  ,
    img: 
    "https://assets.myntassets.com/f_webp,dpr_1.5,q_60,w_210,c_limit,fl_progressive/assets/images/4030176/2018/4/11/11523426962762-Mens-Nike-Run-Swift-Running-Shoe-4561523426962639-1.jpg"
  },
  "Men Black QUEST 2 Running Shoes": {
   name: "Men Black QUEST 2 Running Shoes", 
   price: "Rs.4500" ,
   img:
     "https://assets.myntassets.com/f_webp,dpr_1.5,q_60,w_210,c_limit,fl_progressive/assets/images/9798177/2019/7/31/ea6fb29b-fadf-4c4d-bb09-43fb1cd1e2341564577132487-Nike-Men-Black-QUEST-2-Running-Shoes-7941564577130645-1.jpg"
  },
  "Men Blue RUNALLDAY Running Shoes": {
    name: "Men Blue RUNALLDAY 2 Running Shoes", 
    price: "Rs.3500" ,
    img:
      "https://assets.myntassets.com/f_webp,dpr_1.5,q_60,w_210,c_limit,fl_progressive/assets/images/11652428/2020/6/2/8a3be5f1-1af9-4f41-b949-52db0a5e697e1591086617703-Nike-Run-All-Day-2-Mens-Running-Shoe-7321591086614240-1.jpg"
   },
   "Men Grey QUEST 2 Running Shoes": {
    name: "Men Grey QUEST 2 Running Shoes", 
    price: "Rs.5000" ,
    img:
      "https://assets.myntassets.com/f_webp,dpr_1.5,q_60,w_210,c_limit,fl_progressive/assets/images/11652414/2020/6/30/1ff3a9af-8e6f-4bb1-a84f-281ecf83817b1593512938241-Nike-Men-Grey-QUEST-2-Running-Shoes-681593512935559-1.jpg"
   },
   "Men Black RENEW RUN Running Shoes": {
    name: "Men Black RENEW RUN Running Shoes", 
    price: "Rs.6500" ,
    img:
      "https://assets.myntassets.com/f_webp,dpr_1.5,q_60,w_210,c_limit,fl_progressive/assets/images/11652590/2020/6/2/b50d3832-dee8-4bf4-b99b-aea805b7fac61591083793157-Nike-Renew-Run-Mens-Running-Shoe-1791591083790840-1.jpg"
   } 

 }
